import { FooterDiv, FooterBig, FooterSmall } from "./styledComponent";

function Footer() {
  return (
    <FooterDiv>
      <FontAwesomeIcon icon={faReact} />
      <FooterBig>for react study</FooterBig>
      <FooterSmall>2022. by mingyu</FooterSmall>
    </FooterDiv>
  );
}

export default Footer;
